def gcd(a, b):
    while a:
        (a, b) = (b % a, a)
    return b

def find_max_sub_rectangle(n, m, x, y, a, b):
    g = gcd(a, b)
    a //= g
    b //= g
    k = min(n // a, m // b)
    w = k / a
    h = k * b
    ans = [x - w + w // 2, y - h + h // 2, x + w // 2, y + h // 2]
    if ans[0] < 0:
        ans[2] -= ans[0]
        ans[0] = 0
    if ans[1] < 0:
        ans[3] -= ans[1]
        ans[1] = 0
    if ans[2] > n:
        ans[0] -= ans[2] - n
        ans[2] = n
    if ans[3] > m:
        ans[1] -= ans[3] - m
        ans[3] = m
    return tuple(ans)

